    icmp_ln13_fu_126_p2 = (!idx_0_reg_115.read().is_01() || !ap_const_lv10_3E8.is_01())? sc_lv<1>(): sc_lv<1>(idx_0_reg_115.read() == ap_const_lv10_3E8);
