void doGain::thread_idx_fu_132_p2() {
    idx_fu_132_p2 = (!idx_0_reg_115.read().is_01() || !ap_const_lv10_1.is_01())? sc_lv<10>(): (sc_biguint<10>(idx_0_reg_115.read()) + sc_biguint<10>(ap_const_lv10_1));
}

